        "hrzone_intro_understandhr_des": MessageLookupByLibrary.simpleMessage(
            "Ogni zona di frequenza cardiaca influenza il tuo corpo durante l\'allenamento. Concentrandoti su diverse zone, puoi costruire una routine equilibrata per la forza, la resistenza e la potenza. Le zone più basse sono ideali per il riscaldamento e il recupero, mentre le zone più alte favoriscono i progressi"),
