            MessageLookupByLibrary.simpleMessage("Zona 1 Riscaldamento"),
        "hrzone_intro_zone1_des": MessageLookupByLibrary.simpleMessage(
            "L\'allenamento in questa zona migliora la capacità del tuo cuore di pompare il sangue e migliora la capacità dei muscoli di utilizzare l\'ossigeno. Il corpo diventa più efficiente nel nutrire i muscoli in attività e impara a metabolizzare i grassi come fonte di carburante."),
