            MessageLookupByLibrary.simpleMessage("Zona 3 Aerobico"),
        "hrzone_intro_zone3_des": MessageLookupByLibrary.simpleMessage(
            "Più efficace per la forma fisica cardiovascolare generale. Aumenta la capacità cardiorespiratoria: cioè la tua capacità di trasportare il sangue ossigenato alle cellule muscolari e di allontanare il biossido di carbonio dalle cellule. Effettivo anche per aumentare la forza muscolare complessiva."),
        "hrzone_intro_zone4":
            MessageLookupByLibrary.simpleMessage("Zona 4 Soglia"),
        "hrzone_intro_zone4_des": MessageLookupByLibrary.simpleMessage(
            "Il punto in cui il corpo non riesce a rimuovere l\'acido lattico così rapidamente come viene prodotto è chiamato soglia del lattato o soglia anaerobica. Si verifica generalmente intorno all\'88% della Zona di Frequenza Cardiaca. L\'allenamento in questa zona aiuta ad aumentare la soglia del lattato, migliorando le prestazioni. L\'allenamento in questa zona è difficile: i muscoli sono stanchi, la respirazione è pesante."),
        "hrzone_intro_zone5":
            MessageLookupByLibrary.simpleMessage("Zona 5 Massimo"),
        "hrzone_intro_zone5_des": MessageLookupByLibrary.simpleMessage(
