        "workouts_detail_info_hrv_content1": MessageLookupByLibrary.simpleMessage(
            "La variabilità della frequenza cardiaca, nota anche come VFC, rappresenta la varianza nel tempo tra ogni battito. Quindi, mentre la tua frequenza cardiaca misura quante volte il tuo cuore batte al minuto, la VFC è la varianza nel tempo tra quei battiti."),
        "workouts_detail_info_hrv_content2": MessageLookupByLibrary.simpleMessage(
            "La variabilità della frequenza cardiaca è una rappresentazione importante di quanto bene sei in grado di affrontare e riprenderti dallo stress, che sia un fattore di stress fisico (come l\'esercizio fisico o la malattia) o un fattore di stress emotivo e mentale (come l\'ansia). Aumentare la tua variabilità della frequenza cardiaca significa dormire meglio, ridurre il dolore e migliorare la tua salute e forma fisica complessive."),
        "workouts_detail_info_hrv_content3_1": MessageLookupByLibrary.simpleMessage(
            "La tua variabilità individuale della frequenza cardiaca è rappresentata dal tuo punteggio HRV. La HRV è generalmente misurata in millisecondi, con un punteggio HRV più alto che indica una migliore salute."),
        "workouts_detail_info_hrv_content3_2": MessageLookupByLibrary.simpleMessage(
            "Per capire perché un punteggio HRV elevato è un indicatore di buona salute, è necessario sapere che la variabilità della frequenza cardiaca è controllata dal sistema nervoso autonomo (o ANS). Il sistema nervoso autonomo regola le funzioni corporee involontarie (come digestione, pressione sanguigna, respirazione e frequenza cardiaca) ed è composto da due rami: il sistema nervoso simpatico (\"modalità di lotta o fuga\") e il sistema nervoso parasimpatico (\"modalità di riposo, digestione e recupero\")."),
        "workouts_detail_info_hrv_content3_3": MessageLookupByLibrary.simpleMessage(
            "Il sistema nervoso simpatico, comunemente noto come modalità \"combatti o fuggi\", si attiva involontariamente quando il tuo corpo percepisce una minaccia. Per proteggersi, il corpo utilizza il sistema nervoso simpatico per accelerare la respirazione, aumentare la pressione sanguigna e aumentare gli ormoni dello stress come il cortisolo, per assicurarsi di avere tutta l\'energia e le risorse necessarie per mantenerti al sicuro in una situazione pericolosa."),
        "workouts_detail_info_hrv_content3_4": MessageLookupByLibrary.simpleMessage(
            "Il sistema nervoso parasimpatico, comunemente noto come modalità \"riposo e digestione\", è uno stato di relax. Riduce la frequenza cardiaca, rallenta la respirazione e consente al tuo corpo di tornare all\'omeostasi (un equilibrio naturale). Quando ti trovi in uno stato parasimpatico, il tuo corpo si sente al sicuro, ridistribuendo il flusso sanguigno e l\'energia a funzioni restaurative come il sonno, la digestione e la riproduzione."),
        "workouts_detail_info_hrv_content3_5": MessageLookupByLibrary.simpleMessage(
            "Pertanto, una elevata varianza nel tempo tra i battiti cardiaci, anche nota come elevato punteggio di HRV, significa che il tuo sistema nervoso autonomo è in grado di reagire in modo efficiente attivando il sistema nervoso simpatico per affrontare situazioni stressanti e poi passando allo stato parassimpatico rilassato quando la minaccia è passata."),
        "workouts_detail_info_hrv_content4_1": MessageLookupByLibrary.simpleMessage(
            "Valutazione dell\'intensità e del recupero: Monitorando la HRV, gli individui possono ottenere una comprensione più accurata dei livelli di affaticamento fisico e dello stato di recupero. Una HRV più bassa potrebbe indicare un sovrallenamento o un recupero insufficiente, suggerendo eventuali aggiustamenti al piano di allenamento, come l\'aumento dei periodi di riposo o il passaggio a esercizi a bassa intensità per evitare sforzi eccessivi."),
        "workouts_detail_info_hrv_content4_2": MessageLookupByLibrary.simpleMessage(
            "Connessione tra stress psicologico e prestazioni fisiche: Lo stress psicologico prolungato può portare a una diminuzione della HRV, influenzando le prestazioni sportive. Pertanto, mantenere una buona HRV contribuisce a stati psicologici e fisiologici ottimali, migliorando così le prestazioni competitive."),
        "workouts_detail_info_hrv_content5": MessageLookupByLibrary.simpleMessage(
            "In sintesi, la variabilità della frequenza cardiaca svolge un ruolo cruciale nella guida delle routine di esercizio individuali, nel monitoraggio dello stato di salute generale e nella previsione delle prestazioni sportive. Tracciando e analizzando le variazioni nella HRV, gli individui possono prendere decisioni informate e scientifiche sul loro regime di fitness."),
